  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pid` int(10) NOT NULL COMMENT '菜单父级ID',
  `name` varchar(100) DEFAULT NULL COMMENT '菜单名称',
  `link` varchar(100) DEFAULT NULL COMMENT '菜单连接',
  `ico` varchar(100) DEFAULT NULL COMMENT '菜单图标',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=utf8 COMMENT='系统菜单表';

-- ----------------------------
-- Records of sys_menu
-- ----------------------------

