-- ----------------------------
-- Table structure for `sys_push`
-- ----------------------------
DROP TABLE IF EXISTS `sys_push`;
CREATE TABLE `sys_push` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键PK',
  `content` varchar(500) DEFAULT NULL COMMENT '消息内容',
  `createtime` datetime DEFAULT NULL COMMENT '消息发送时间',
  `alias` text COMMENT '接收人',
  `ptype` int(1) DEFAULT NULL COMMENT '推送类型1-用户2-商家',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

