-- ----------------------------
-- Table structure for `sys_version`
-- ----------------------------
DROP TABLE IF EXISTS `sys_version`;
CREATE TABLE `sys_version` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键PK',
  `version` double(5,2) DEFAULT NULL COMMENT '版本号',
  `description` text COMMENT '更新描述',
  `app_path` varchar(255) DEFAULT NULL COMMENT '上传安装包路径',
  `os` varchar(20) DEFAULT NULL COMMENT '操作系统 ios/android',
  `type` int(1) DEFAULT NULL COMMENT '0-强制 1-可跳过 2 无升级版本',
  `createtime` datetime DEFAULT NULL,
  `isopen` int(1) DEFAULT '0' COMMENT '是否开启更新0-未开启1-已开启',
  `isdel` int(1) DEFAULT '0' COMMENT '是否删除0-未删除1-已删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sys_version
-- ----------------------------

-- ----------------------------
-- Table structure for `timelimit`
-- ----------------------------
DROP TABLE IF EXISTS `timelimit`;
CREATE TABLE `timelimit` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '主键PK',
  `productid` int(10) NOT NULL COMMENT '产品id',
  `tlnum` int(10) NOT NULL COMMENT '产品数量',
  `tlprice` double(10,2) DEFAULT NULL COMMENT '抢购价钱',
  `tltime` varchar(200) DEFAULT NULL COMMENT '抢购时间段',
  `buynum` int(10) DEFAULT NULL COMMENT '抢购限量数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='限时抢购表';

-- ----------------------------
-- Records of timelimit
-- ----------------------------
